 | 12:15 Ушли со Шпицов.
 | 13:30 Пришли на озеро Несамовытое.

**22.07 оз.Несамовытое - г.Туркул (1933.2 м) - г.Данциж (1848.5 м) - г.Пожижевска (1822.2 м) - г.Брескул (1911.5 м) - г.Говерла (2060.8 м)**
