**26.07 Утро в Днепропетровске**
 Поход удался!

**Вода**
 - оз.Моричайка - г.Поп Иван - напряжно (есть плохие ручейки);
 - г.Поп Иван - оз.Бребенескул - было пару луж;
 - оз.Бребенескул - оз.Несамовытое - не видели;
 - оз.Несамовытое - г.Говерла - один источник между г.Пожижевская и г.Брескул;
 - г.Говерла - г.Петрос - много.

**ВЫВОДЫ**
 - с едой надо  быть повнимательнее
 - маршрут можно пройти за 3-4 дня  при хорошей погоде
