INSERT INTO "report" VALUES(85,84,'','В этом году весна была поздняя и поэтому решили идти в низкие горы, чтоб там точно не было снега. Кроме того еще одним критерием, повлиявшим на выбор маршрута, было мое желание сделать поход не сложным, прогулочным. Даже рассматривался вариант проживания в каком-то недорогом пансионате в красивом месте с возможностью радиалок. В конце-концов решили ехать в с.Шешоры и формировать маршрут по месту.

-----

25 апреля
---------

Сборы и выезд из Днепра
=======================

13:32 поезд Днепропетровск-Трускавец.

26 апреля 
---------

Тернополь - Ивано-Франковск - с.Пистень - с.Шешоры - вдп.Шешорские гуки
=======================================================================

Как показывает опыт до Ивано-Франковска (далее И.-Ф.), откуда начинается бОльшая часть карпатских походов, удобнее всего (быстрее!) добираться из Тернополя.

5:57 прибытие в Тернополь.

Теперь очень быстро нужно было добраться до автовокзала, т.к. в

6:30 маршрутка на И.-Ф.

До автовокзала ехали на городском микроавтобусе, садиться на него нужно на противоположной стороне привокзальной площади. 

9:30 В И.-Ф. Купили билеты до Косова на маршрутку И.-Ф. - Верховина, отправлявшуюся в 9:35. Ехали долго, усталость от переездов росла, придавала силы лишь мысль, что осталось совсем немного, по сравнению с путем, лежавшим позади. 

12:30 Вышли из маршрутки не доезжая до Косова в селе Пистень (на повороте на с.Шешоры).
Ура!!! Мы на маршруте :). Прошли мимо двух магазинов, подкупили немного продуктов. По дороге зашли на территорию деревянной церкви Успения Пресвятой Девы Богородицы (как гласит табличка - самой старой церкви Гуцульщины). Прямо возле церкви было кладбище, усопших на которое, переправляли через реку специальным подвесным приспособлением (первый раз такое видели). 
До захода солнца было еще много времени, поэтому к Шешорским водопадам мы решили идти не селом, а через лес, делая правда небольшой крюк. Выбрав полянку с красивым видом, остановились на перекус. Вдалеке виднеется здание санатория "Шешоры", построенное еще в 80-е годы. Пошли дальше.
Как оказалось и подтвердится позже еще не раз, наша карта имела много неточностей, поэтому ориентируясь исключительно по ней мы вышли не совсем там, где планировали. Пришлось таки немного топать по селу.

~ 16:00 Пришли к месту, где на карте обозначен вдп.Шешорские Гуки. Перед нами мост, а возле него ресторан "Аркан" и магазин. Поспрашивали у людей где водопад, оказалось что их два: выше по течению - Малый Гук, ниже - Большой. Учитывая тот факт, что водопады находились недалеко от шоссейной дороги, мы предполагали что людей там будет много. Но оказалось, что Большой Гук не пользовался популярностью (думается не все приезжие знали о его существовании, да и места для пикника там как такового не было), а вот на Малом - отдыхающих было действительно много (выходной день ко всему прочему). Полюбовались - пошли дальше. Пока шли по селу видели несколько коттеджей со сдаваемым жильем, но погода была хорошая: тепло, солнышко, решили продолжать маршрут. Далее наш путь лежал на озеро Лебедин.

17:30 Вышли на тропу, ведущую на озеро, и покинув село начали резко набирать высоту. Далее шли по буковому лесу - просто сказочному с молодыми светло-зелеными листочками. 

19:30 Нашли приятную полянку с обрывом и видом на стену леса и решили остановиться на ночевку. Ориентировочно мы находились недалеко от моста. До 9 вечера было относительно светло, поэтому неспеша сварили супчик, чай, поужинали.
22:00 Легли спать. 

27 апреля 
----------

Озеро Лебедин
=============

8:45 Подъем. Утро замечательное: ясное небо, тепло, слабый ветерок.

12:00 Вышли на маршрут. Мы действительно вскоре увидели мост, но как оказалось их там несколько. Немного поблукав нашли нужную дорогу, продолжаем путь. Карта жжет :). 

14:30 Пришли на озеро. Первым вестником, что где-то здесь находится озеро, была оборудованная стоянка. Само озеро оказалось довольно большим по площади, но тем не менее активно мельчающим и зарастающим. Вцелом нам очень понравилось, решили здесь остаться до утра. 
Сегодня за весь день встретили одного человека, радует, что идем по такому непопулярному маршруту, все таки хочется единения с природой.

28 апреля
---------

оз.Лебедин - с.Шешоры
=====================
Сегодня Гриша проснулся со страшно опухшей щекой, нагнало флюс. Оказывается у него еще в поезде начал ныть зуб. Решение возвращаться в населенный пункт было подкреплено звонком стоматологу, порекомендовавшей срочно вскрывать зуб. Вспомнили, что в Шешорах как раз видели стоматологический кабинет, туда и пошли.

10:20 Вышли с озера. Оказалось, что вчера мы шли по лесу по маркированной тропе, но маркер как-то странно нанесен, что виден только когда движешься по направлению в село. Вниз было идти намного легче, поэтому пришли довольно быстро. 
12:30 Возле ресторана "Аркан".
Оказалось что в домике со стоматологическим кабинетом работают строители - делают второй этаж, врача нет. К счастью он вскоре приехал, но сказал, что не принимает. Однако увидев Гришу, сразу посадил его в кресло. Процедура была проведена быстро, как говорится без шума и пыли :). Щека хоть и осталась большой, но теперь мы знали, что нужно немного времени и много полосканий и все будет хорошо. Продолжать сегодня поход в таком состоянии было нецелесообразно, мы все таки пришли отдыхать, а не испытывать организм. Поэтому решили искать жилье до завра. Из дома было припасено пару контактов в местных пансионатах, однако они не понадобились. Только я собиралась позвонить по телефонам, как к нам подошла женщина (работающая медсестрой в больнице неподалеку) и предложила остановиться у нее в доме. Цена была относительно высокая (50грн с человека), однако, как оказалось, условия проживания того стоили. 

Женщина была приятная, звали ее Галя.  Жила она в большом доме с дочкой, зятем и внуком. Поселили нас в отдельную комнату, в нашем распоряжении был санузел с душем и кухня. Погода была отличная, отдыхать в доме Гриша не хотел, решили пойти поваляться на водопадах. К нашей радости людей на водопадах не было (понедельник что ли), лишь на Большом Гуке ловили рыбу рыбаки. 

Вечером обсудили дальнейший план действий, на следующий день решили идти на гору Грегит (самую высокую из близлежащих, 1472 м.) и подходящую нам по направлению. Закончить маршрут собирались в с.Космач, где по информации Галины должен был 1 мая начинаться фестиваль-ярмарка.

Раззнакомились с Галей, оказалось что принимать приезжих для нее привычное дело, т.к. с 2003 года в селе проводился фестиваль этнической музыки с одноименным названием "Шешоры". Однако с 2007 года место проведения сменилось к всеобщему расстройству местных жителей, хорошо зарабатывавших во время фестиваля. Как и в других карпатских селах здесь была проблема с оплачиваемой работой. Оказалось, что Галина и дочка очень красиво вышивают (в основном вышиванки) и вяжут носки из натуральной шерсти, потом все это продают на различных фестивалях и ярмарках. 

29 апреля
---------

с.Шешоры - с.Брустуров - г.Грегит
=================================

Утром снова прогулялись на водопады, Гриша чувствовал себя хорошо. Собрали вещи. Решили подъехать до с.Шипот и уже оттуда в горы. Попрощались с Галей, взяли на всякий случай телефон.

12:10 Были возле магазина "Водопад", здесь что-то вроде остановки. Узнали в магазине, что подходящий нам автобус будет только в 13:30. Решили не ждать. Словили первый проезжающий микроавтобус (в 12:25), который за полчаса безвозмездно довез нас до конца села Брустуров. 

13:15 Дошли до нужного нам (судя по карте) поворота. Ура снова в горы! Свернули на тропу перед табличкой Шепот, перешли через ручей. Повернули на право, затем налево и дальше вгору. Шли по хорошей дороге, вверх и вверх и снова вверх. В основном шли по открытой местности, вокруг нас были "разбросаны" хаты. Причем их расположение иной раз просто поражало: на самых вершинках гор, вдалеке от магазинов, это ж какие не ленивые люди там жили, не испорченные "благами" цивилизации. 

Ближе к вершине "населенка" закончилась, шли по лесу. Издалека увидели, что на горе еще лежит снег. Тут был самый сложный и крутой подъем, радовали лишь полянки крокусов :). Уже долгое время идем без воды, встреченный ранее дедушка сказал, что на горе вода есть. Не соврал, однако ручей оказался очень маленьким, набрать воду из него не удалось. Склоны горы покрыты каменистыми россыпями, тропинка иногда терялась.

16:45 На г.Гергит. Вершина оказалась красивая, эксклюзивности придавали сугробчики и крокусы, сквозь ветки высоких смерек светило солнце. Тем не менее было что-то в горе тревожное и неприветливое. Гриша нашел место для стоянки с видом на Черногорский хребет. 

19:00 Начали готовить ужин, впервые в жизни топили снег :). Вскоре чуть справа от нас начало садиться солнце - закат был сказочно красивым. Сразу же резко похолодало. 

30 апреля
---------
г.Грегит - полонина Мунчелык - долина реки Пистенька-Космацька - с. Космач
==========================================================================

Проснулись,а  на улице идет дождь. Сегодня нам нужно дойти как можно ближе к селу Космач, завтра там будет фестиваль и нам нужно уезжать. Посмотрели карту, вроде пока времени немногое есть, решили переждать дождь в палатке. К обеду действительно распогодилось, покушали, собрали вещи.

15:00 Вышли из лагеря в солнечную погоду, небо чистое. Решили идти в Космач через г.Мунчелык. Вышли на довольно хорошую дорогу, вокруг красота. Не прошли и часа как стало греметь и начался град, за ним дождь. Горы есть горы :)! Продолжаем идти. 

Дошли до полонины Мунчелык, пофоткали Говерлу (ее отсюда очень хорошо видно) и не заходя на г.Мунчелык начали спускаться серпантином в долину реки Пистенька-Космацька. 

18:00 На реке. Перекус. Все больше склоняемся к варианту идти в село и ночевать там. Несмотря на очень крутой склон, по которому мы спускались, 2 ЗИЛа и лошадь отлично преодолели на наших глазах такой подъем (возят лес). 
Судя по карте нам предстояло перейти большое количество мостов, онако оказалось, что мостов то и нет, а переходить реку таки нужно многократно. Ничего, справились, даже ноги не промочили. Впервые в жизни видели саламандр, да еще и в таком количестве.

19:30 Вышли к началу села. Решили идти как можно ближе к центру и искать ночлег там. Через полчаса поговорили с шедшей навстречу бабушкой (очень приятной), узнали что до центра еще 4 км. 

21:00 В центре. У кого бы остановиться. Здесь уже начиналась подготовка к завтрашнему празднику: строили сцену, ставили палатки...
Вскоре подошла девочка и предложила ночлег за 40грн с человека в теплой комнате, 30грн - в холодной (на полу). Хата оказалась 20 мин от центра, хотя по меркам села это считалось недалеко. Я такой бедноты никогда не видела. В домике жила женщина с двумя дочками (подростками), еду готовили в печи, туалета не было (ходили в лес), из электроприборов имелся только чайник и тот сильно протекал. Решили здесь таки остаться, хорошо что смогли помочь людям, хоть деньгами.

1 мая
-----

с.Космач - Коломия - Тернополь
==============================

9:00 Пошли на ярмарку с рюкзаками. Узнали, что автобус на Коломыю в 11:20 (у нас есть 2 часа на прогулку). Торгующих на ярмарке было довольно много, но кроме изделий настоящих умельцев (очень и очень впечатляющих), часто встречался "шерпотреп". Сцена еще не работала. Количество приезжающих росло на глазах, в основном конечно это молодежь с палатками (им выделяли отдельное место для стоянки). Здесь мы встретили наших знакомых из Шешоров, продающих свои изделия - вышиванки и носочки.  

12:25 В Коломыи. Взяли в кассе билеты до Тернополя на автобус, отправляющийся в 13:05. На Львов автобус был в 14:00. И до Львова и до Тернополя автобусы идут по 5 часов. ','reStrucuredText',NULL,'2010-06-01 19:47:52.094226','2010-08-11 14:27:39.161570');
INSERT INTO "report" VALUES(96,1,'','Вышло 4 дня выходных - захотелось на море...

Пожелания:
----------
- дикий пляж, без оплаты за палатко-место или человеко-место;
- поменьше народу;
- чистое море;
- отсутствие проблем с питьевой водой;
- не лишнее - близость населенного пункта;

Куда поехать?
-------------

**Варианты:** Балаклава, Лисья бухта, Фиолент, Ласпи, Тарханкут.

-----

Остановились на Тарханкуте. Первоначально наткнулись на несколько отчетов в интернете при штурме последнего. Отчеты понравились. Основные отзывы: "дикость" - в прямом смысле этого слова, т.е. народа очень мало или вообще нет :), чистое море.

Разведка Тарханкута
-------------------

Стали искать информацию подробнее.

- Очень помог `форум на chernomorskoe.info <http://chernomorskoe.info/forum/>`_ . Написали там, спросив совета в соответсвующей теме. Люди сразу откликнулись, по их советам и определили конечное место отдыха.
- `Хорошая карта Крыма <http://tie-games.narod.ru/maps/crimea.html>`_

**Было решено ехать в с. Оленевка.**


24.08
-----------------
На поезде (из Днепропетровска) мы доехали до Симферополя (около 14:00), из него до с.Оленевка был один прямой автобус в 8 утра, было решено ехать до Евпатории (автобусы каждые 10 мин.), езды около 1 часа. В Евпатории нам очень повезло, автобус отправлялся через 10 мин на Оленевку, следующий за ним был не скоро (часа через 2-3). Ехать пришлось в основном стоя (сидела Катя - не на очень хорошем месте), автобус был старый, львовский. Поездка нас утомила: порядка 2.5 - 3 часов.

Приехали уже вечерело :) (около 19:00). На пляж дошли за 30 мин, шли мимо рынка и частного сектора с бесконечными табличками "сдам жилье". Место для палатки на пляже нашли быстро, сначала решили просто пока встанем "тут" временно (а в конце концов простояли все время на этом месте). Там, где мы остановились, был песок, в нашей окрестности вообще много песка было. Места в тени деревьев были заняты, во-первых деревьев очень мало, да и тень от них была "не очень". Поставили палатки, покупались, попили пиво, которое купили в селе. Было решено сходить в радиалки, с целью поиска нового места, но уже на следующий день.


25.08
-----
Море, погода - суппер. Узнали, что есть туалет по 1.5 грн, душ - 3 грн, и опресненная вода 1л - 10 коп.

Решили первую **радиалку сделать в сторону Маяка** (Катя и Гриша). По мере удаления от цивильного пляжа, в море стали появляться камни, да и на берегу тоже. В районе Маяка есть магазин, как нам и говорили. За маяком начинаются обрывы, там есть дайвинг центр, есть подводный музей якорей. Красиво, но спускаться с этих обрывов к морю - не очень прикольно, прошли еще немного и стали возвращаться. Было решено, что в сторону маяка смысла переезжать с палаткой нет. Места становятся каменистее, удаляешься от цивилизации и самодельные туалеты тут имеют свою актуальность :). Правда некоторые члены нашей группы полюбили ходить в туалет "в поле" по утру :). После радиалки пошли в село (Андрей и Юра), делать покупки на вечер. Походы в село совсем ненапряжные.


26.08
-----
Утром Андрей с Юрой пошли к Маяку (может дошли до Атлеша). Купались, отдыхали. К вечеру поднялся ветер, а вместе с ветром - и волны, поныряли в волны :). Виндсерфингисты в свою очередь погоняли по этим волнам.


27.08
-----
**Радиалка в сторону Джангуля** (Катя и Гриша). Пошли по пляжу, дошли до санатория, далее вышли из него и пошли напрямик через степь (нам подсказали направление), мимо водонапорной старой башни и дальше. Вокруг степь, слева еще один маяк был. Потом вышли опять к пляжам, так называемая Бухта Газпрома. Есть колодец с нормальной водой (правда Андрею и Юре не очень понравилась). Люди есть, но не много, спуск к морю нормальный, палатки стоят на обрывах, один не достаток - грязно. Там где мы остановились видно что пляж убирают, тут же вокруг огромные кучи мусора, которые люди оставляют после себя. Идем дальше - обрывы все больше, людей меньше. Очень красивые места начинаются в начале Джангуля, даже есть места где встать с палатками, правда нужно нести все с собой, но если хочется "дикаря" и неописуемой красоты - то это того стоит. На дорогу ушло около 2 часов в одну сторону. От колодца - 30 мин.


28.08
-----
Андрей с Юрой с утра пошли в сторону Джангуля, вернулись довольные.

**Отъезд**. Прямой автобус до Симферополя один (около 13:00), мы ехали обратно опять через Евпаторию.
Узнали что из Днепропетровска ходят `прямые маршрутки <http://leto.vlavlat.com.ua/>`_ до с.Оленевка по 90 грн.


Выводы:
-------

- Пляж нам очень понравился, стоять очень удобно немного в стороне от городского пляжа (если спиной к селу стоять, то влево, там где домики на колесах). Удобно в плане туалета, воды и близости села. Вода в море чистейшая. Людей с учетом праздника 24.08 и выходных было довольно не много, под конец совсем пляж опустел.
- С собой нужен навес - обязательно!
- Еду можно не брать, все можно купить в Оленевке, готовить только на горелке! - дров не найти. Вода опресненная годится только для приготовления пищи, для питья нужно покупать в селе.
- Можно взять еду и воду и на день-два сходить в сторону Джангуля, очень красиво и дико.
- Вина на разлив типа "Черный полковник" - обман, таких сортов винограда уже давно нет, вино лучше брать в магазинах.
- Цены на продукты, воду, пиво в селе не очень высокие - немного дороже, но то и понятно.
- Если погода не позволяет стоять на пляже с палатками, в крайнем случае можно снять жилье (его сдают на каждом углу).
','reStrucuredText',NULL,'2010-08-17 00:52:19.305683',NULL);
INSERT INTO "report" VALUES(99,98,'','И снова в горы! Еще в весеннем походе с Олей запланировали, что пойдем в конце лета в Карпаты есть ягоды. Так и случилось. Снова ответственность за формирование маршрута и продуктовую раскладку взяли на себя Андрей и Оля. Нам только оставалось собрать личное снаряжение и доехать до Ивано-Франковска. Меня кроме всего прочего радовала мысль, что мы едем в более прохладное место, жара этим летом вымотала.

17 августа
==========
14:08 Отъезд из Днепродзержинска поездом №41 Днепропетровск-Трускавец.

18 августа
==========
Тернополь — И.-Франковск — с.Лазещина — т/б Козьмещик
-----------------------------------------------------

5:57 Приехали в Тернополь. Быстро садимся на подходящую маршрутку до автовокзала. Взяли  в кассе билеты на автобус до Ивано-Франковска.

6:30 Отправились. Дорога заняла ровно 3 часа.

----

В 9:30 на автовокзале нас встретил Андрей. Погода супер — прохладно! :) Еще в автобусе мы решили, что зайдем к ребятам в гости, оставим ненужные в походе вещи и позавтракаем. Андрей был настроен купить билеты до Лазещины заранее. В кассе автовокзала, который теперь находится в новом здании, мы узнали, что ближайший рейс в 9:40 (он нам из вышеописанных соображений не подходил), следующий - в 12:35, на него и взяли билеты. 

У ребят в гостях мы были впервые. Как оказалось, живут они совсем недалеко от вокзала. Попили чай, обработали водоотталкивающей пропиткой обувь, собрались и дружной бригадой из 4 человек пошли на маршрутку.

Как оказалось мы взяли билеты на проходящий рейс (Львов-Рахов) и несмотря на указанные в билетах места, сесть удалось не всем желающим ехать. Мы с Олей успели занять 3 места на 4-х. После небольшой задержки, в результате несоответствия количества проданных в кассе билетов и свободных мест в автобусе, наконец выехали.

12:50 Едем. До с.Лазещина дорога заняла около 3 часов. Попросили водителя остановить на повороте на т/б Козьмещик, там и вышли.

16:00 Ура! На маршруте! Настроение отличное - боевое. Ах, да, почему решили ехать именно сюда. Дело в том, что под Петросом Оля знала малинник, а т.к. мы ехали пополнять запас витаминов, то собирались начать маршрут с посещения этого места. От Лазещины до Петроса - самый близкий путь. Итак, прошли село довольно быстро. Далее КПП. Андрей зарегистрировал нас, заплатив по 10 грн с человека (это за посещение заповедника на сутки, без стоимости палатки, каждая из последних оплачивается что-то около 15 грн). Пока шли вдоль реки, нас обогнал Краз с группой туристов в кузове, проезжая мимо они приветливо помахали. Дойдя до турбазы Козьмещик, мы перешли речку, повернув направо, и увидели выгрузившихся из машины недавно встреченных нами туристов. Теперь мы точно услышали, что говорят они не по русски. Солнце уже начало двигаться в сторону горизонта, поэтому мы решили искать место ночевки. Остановились на ровной полянке между дорогой и речкой, недалеко от нас разрозненными кучками расположились и иностранцы (позже узнаем, что это чехи). 

Дров хватало, поэтому готовили ужин на огне, газовые баллоны еще пригодятся. Поужинав вкусным борщом, "гоняли" чаи и беседовали. К нам подошел один из соседей (очень приятный и улыбчивый мужчина), начали общаться на английском, от него узнали, что они из Чехии. Самое смешное, что оказалось он отлично владел русским языком! :) Перешли на русский.  

Небо немного затягивало тучками, но мы надеялись на лучшее. В этот вечер у костра сидели довольно долго. По палаткам разошлись уже после 10 часов.

19 августа
==========

под Петросом
------------

6:30 Подъем. Позавтракали кашей и чаем с конфетами. Небо в облаках. Собираем вещи, оставляя наготове дождевые куртки. Как хорошо, что у нас мобильная группа, сборы проходят очень быстро, особенно у Оли с Андреем (как никак за плечами богатый опыт).

7:45 Вышли из лагеря. Вместе с нами потихоньку начали выходить и чехи. Поражало, что большинство из них были предпенсионного возраста, но шли довольно хорошо. Их путь лежал на Черногорский хребет и начинался подъемом на Говерлу. Мы же планировали выйти на перемычку между Говерлой и Петросом (ближе к Петросу) и наесться малины. Как только мы начали уходить от ручья, начался подъем. Дорога шла серпантином, поэтому подниматься было относительно не тяжело. Где-то через полтора часа пути начал моросить дождик. 

11:00 Дошли до назначенного места. Дождь становился все сильнее. Мы никуда не спешили, времени на поход достаточно да и какое удовольствие ходить по дождю, ни красивых видов, ни фотографий не сделаешь. Последнее для Андрея и Оли очень важно, т.к. они профессиональные фотографы и в походах, в отличии от нас с Гришей, кроме всего прочего работают.

Разбили лагерь возле ручейка. Забрались все в домик Оли и Андрея и начали коротать время игрой в покер (кубиками). С неба все лило и лило, даже обедать пришлось в палатке. Часа в 4 дождь прекратился - пошли есть малину. Ее оказалось не так уж чтоб и много, но наесться хватило всем. Ягоды не крупные, но очень ароматные! И снова дождь. Решили на этой стоянке оставаться до утра.

За разговорами и размышлениями над интересными нам темами время пролетало быстро. В свою палатку мы пошли где-то около 10 вечера. Оказалось, что за полдня дождя швы начали немного пропускать воду. Палатке всего 4 года, но видимо она неправильно эксплуатировалась (как мы позже узнали самым губительным для палаток является солнце, а мы не раз оставляли ее под палящим солнцем Крыма на весь день). Только улеглись, как дождь перешел в ливень. Соответственно вода стала проступать активнее. У меня сон как рукой сняло, лежу в напряжении и понимаю, что ситуация только усугубляется. Наконец решили сообщить ребятам о нашей ситуации. Они забрали нас к себе. Так в тесноте, да не в обиде мы крепко проспали до утра.

20 августа
==========
г.Петрос - с.Квасы
------------------ 

Вчера решили, что если погода до утра не прояснится, то будем возвращаться в И.-Франковск. К общей радости утро было солнечным, лишь изредка пролетали облачка. 

6:45 Подъем. Подкрепились завтраком, приготовленным на горелке и начали сушить вещи. Самым досадным происшествием для меня оказались забытые под дождем ботинки и соответственно на утро абсолютно мокрые. Спасибо Оле, привыкшей к мокрой обуви в кавказских походах, что временно поменялась со мной ботинками.

8:45 Вышли из лагеря. На Петрос решили не идти, т.к. была вероятность ничего не увидеть, если к тому времени вершину затянет облаками, да и мы там уже раньше были. Поднялись на дорогу, идущую от Говерлы к Петросу и справа от дороги снова встретился малинник. Поели малины и пошли дальше. Дорога отличная, солнышко, тепло. Держим путь в Квасы. Шли все время траверсом, дойдя до перевала на полоныне Скопеска, резко спустились на двухколейную дорогу. Теперь нам только вниз и вниз. Спуск был очень затяжным, поэтому давался довольно сложно. К концу все изрядно вымотались. По дороге встречали несколько групп туристов, все таки Черногорский хребет - очень популярный маршрут.

15:00 Пришли к газированному минеральному источнику в с.Квасы. Вода здесь очень необычная, сразу заметно газированная, но через несколько минут газ выходит и она становится не очень приятная на вкус. в беседке возле источника решили пообедать и отдохнуть. В магазине в селе купили хлеба и мороженного. Отдыхали достаточно долго, за это время мы досушили свою палатку, Оля с Андреем обсудили дальнейший маршрут.

16:45 Продолжаем путь. Решено идти на хребет Свидовец, задача на сегодня - выйти из села в направлении Близниц (на нашей карте их было аж три: просто Близница, Малая Близница и Большая Близница) и остановиться на склоне недалеко от источника. 

От беседки пошли по направлению к трассе, перешли мост и потопали по шоссе вверх вдоль реки. Через 15 минут свернули влево (в горы). Сразу начался крутой подъем и усталость давала о себе знать. Сначала изредка встречались домики, вскоре они закончились, оставалось найти более менее ровное место для палаток.

18:15 После двух радиалок Андрей привел нас на подходящее место. Ура! Становились на ночевку среди лиственного леса, сегодня готовим ужин на костре. На карте был указан источник, но он оказался пересохшим, ребята за водой спускались на речку (не далеко). Душевно поужинали и в 21:30 легли спать. Завтра нас ждет черника и ледниковые озера! :)

21 августа
==========

пол. Бреска - г. Близница - г.Большая Близница - пол.Драгобрат - г.Стиг - оз.Геришаска(Догяска) - оз.Апшинец(Трояска)
---------------------------------------------------------------------------------------------------------------------

Утром выпала обильная роса, пришлось сушить палатки, что немного нас задержало. Погода прекрасная, жара. 

8:45 Вышли в путь. Сначала круто поднимались лесом, как только вышли на полонину Бреска началась черника. Остановились поесть. Андрей нашел приспособление, которым местные собирают ягоду на продажу (похожее на расческу с прикрепленной коробочкой). На полоныне набрали воды, т.к. следующий источник будет не скоро и пошли на Близницу. 

13:30 Гора покорена :). Решили здесь пообедать. Далее по хребту (мы уже на Свидовце, кстати, ура!) пошли на Большую Близницу. Вокруг открывались очень красивые виды. Я вообще из-за этого очень люблю ходить по безлесным хребтам. Маршрут этот также популярный, кроме того здесь можно ездить даже на джипах. Проходя мимо горнолыжного курорта Драгобрат обнаружили, что он "расширяется" - строится еще один подъемник. Сегодня весь день воду несли с собой, на хребте первый источник встретился лишь под горой Стиг.

17:30 Подошли к повороту на оз.Геришаска(Догяска). Нас Гришей поразило величие и красота долины, в которой находилось озеро, ее масштабы! Оля сказала, что скорее всего здесь раньше лежал ледник и потом он сходил вниз и образовывал своеобразные ступеньки (сбросы высоты). Исходя из опыта прошлого похода, наши друзья, не хотели ночевать здесь, т.к. знали что на озере любят отдыхать местные, заезжающие сюда на джипах и ЗИЛах, и сочетающие отдых на природе с употребление горячительных напитков. Нам же хотелось единения с природой. Решили идти на оз.Апшинец(Трояска), благо оно было недалеко. Замечу, что издалека на оз.Догяска мы не видели ни одной машины. 

18:00 Возле спуска к оз.Трояска (у этого озера много названий на разных картах). К нашему удивлению из долины раздавалась довольно громкая музыка из "бобика" и была видна шумная компания, расположившаяся на берегу. Мы изрядно подустали (прошли за день около 25 километров) и нужно было однозначно становиться на ночлег, поэтому решили спускаться. Через пригорок от Трояски было еще одно маленькое озерце, туда пошла ночевать группа без газовой горелки, т.к. деревьев в той долине было явно больше. На озере стояли еще несколько групп, одна из них. как окажется состояла из 22 подростков. Чтоб как-то спрятаться от музыки мы сделали стоянку не на самом берегу, а чуть дальше за пригорком. 

Ужин приготовили на горелке, т.к. думали что здесь нет дров (ели росли разрозненными кучками и невысокого роста), кроме того заедали мошки.

22 августа
==========

оз.Апшинец(Трояска) - г.Большой Котел - пол.Мунчел
--------------------------------------------------

Сегодня проснулась рано, ребята еще спали и я пошла погулять по окрестностям. Оказалось, что дрова таки можно насобирать, что я и сделала. Поела черники, изрядно намочила росой ботинки :). Небо было ясное и когда из-за горы вышло солнышко стало очень тепло. Шумная компания уехала и все стало на свои места, только теперь можно было прочувствовать всю красоту этого живописного места.

Проснулись ребята, позавтракали. Обговорили дальнейший маршрут, к завтрашнему дню нам нужно попасть в Ясиня и оттуда в И.-Ф. Значит можно не сильно спешить, решили сделать полудневку. Собрали палатки и перешли на берег. Гриша пошел купаться и даже плавал, что для меня выглядело очень героическим поступком, учитывая температуру воды (у меня сводило ноги сразу же как только заходила в озеро по колено). Было так хорошо, что даже не хотелось уходить. 

13:30 Таки собрались и начали подниматься обратно на хребет. Андрей поднялся с пользой для общества - насобирав в "чесалку" много черники. В Ясиня решили идти через гору Большой Котел и спускаться в село Черная Тиса. Вышли на гору, отсюда открывался отличный вид на оз. Ворожеска. Решили сделать обед-перекус, кстати как только мы свернули с хребта сразу же перестали встречаться группы туристов, что очень радовало. Этот день стал моим самым любим из всего похода. Вокруг очень красиво, дорога постоянно менялась: то шла по низкой траве, то через кустарник, то по молодому лесу, то по старому. Периодически встречались заросли малины, огромные лопухи, потрясающе красивые мухоморы. Когда мы зашли в молодой лес было большое желание здесь остаться на ночевку, но воды не было, пришлось идти дальше. Когда же мы наконец пришли к ручью, вернее даже не пришли, а услышали его шум, т.к. русло было немного ниже дороги, и начали искать место для стоянки, с этим оказалась небольшая проблема. Лес по обе стороны дороги был глухим и беспросветным.

20:00 В итоге остановились по среди лесной дороги между двух стен сосен. Несмотря на то, что вышли из лагеря только в обед, за этот день прошли около 15 километров.

21:15 Ужин (самый поздний за поход). Готовили на горелке, чтоб сэкономить время да и места для кострища подходящего не было. Ночь наступила очень тихая и светлая, на чистом небе светила яркая почти полная луна. 

23 августа
==========

с.Черная Тиса - пгт.Ясиня - И.-Франковск
----------------------------------------

Ну вот он и последний день похода. 

Расписания автобусов мы не знали, поэтому четких планов когда нам нужно попасть в Ясиня не было. Утром встали не спеша, позавтракали, собрали палатки.

9:45 В путь. Дорога все время шла вниз, но спускаться было не тяжело. Наслаждаюсь последними часами проводимыми в относительно дикой природе. Все время идем в тени деревьев.

11:30 Вышли к селу Черная Тиса. Дошли до магазина, поев мороженого пошли по селу в Ясиня. Далее по дороге лицом к солнцу. Чувствую, что нос, загоревший в предыдущий день, уже окончательно сгорел, но никуда не денешься. Идти по селу не очень интересно, поэтому в голове мысли: скорее бы автовокзал.

13:05 Дошли до автовокзала в Ясиня. Андрей пошел узнавать в кассу, когда мы сможем уехать. Оказалось, что 10 минут назад ушел прямой автобус до И.-Франковска и следующий будет в 13:50 до Яремче. Расписания движения дизеля Рахов - И.-Франковск никто не смог подсказать, решили ждать маршрутку. 

13:50 По расписанию пришел микроавтобус, мы с Олей даже умудрились сесть, позже сели и наши мужчины. Через 1.5 часа мы были в Яремче, там без проблем купили билет до И.-Франковска. Так и приехали :).','reStrucuredText',NULL,'2010-09-05 19:22:57.512101','2010-09-05 19:22:57.512155');
