Контакты
--------
Авторы проекта: **Гриша и Катя Костюк** (Украина)

Для связи email и jabber: **naspeh(at)gmail.com**

Предыстория
-----------

Однажды поняли, что писать отчеты о пройденных походах - это хорошо.  Пару отчетов разместили на сайте друга x-trips.com_, но там не было возможности добавить или отредактировать отчет самому. С того момента искали сервисы, на которых было бы удобно размещать свои отчеты. Подходящих - не нашли. 

Опробовали размещение статей в формате блога, сначала на blogger.com_, потом на существующих блог-движках: byteflow_, drupal_. Последний вариант на pusto.org_ существовал довольно долго (больше года). За это время успели понаблюдать за статистикой сайта и сделали подтверждающий вывод, что отчеты нужны. Люди ищут информацию, как и мы, когда собираются в какие-то новые для себя походы или поездки. У нас сформировалось представление в каком виде хотелось бы видеть отчеты. В конце-концов появилось желание реализовать проект на Python_, а потом и время. 

.. _x-trips.com: http://x-trips.com
.. _blogger.com: http://blogger.com
.. _byteflow: http://byteflow.su
.. _drupal: http://drupal.org
.. _pusto.org: http://pusto.org
.. _Python: http://python.org


О реализации
------------

**Самые главные критерии: простота и удобство.**

Серверный фреймворк - Pylons_ (Python_).  Очень доволен связанными Pylons_ библиотеками:
 - ORM_ - чистый SQLAlchemy_, не стал использовать надстройку Elixir_, т.к. все в SQLAlchemy_ понравилось;
 - система маршрутизации - Routes_, огромный плюс :);
 - шаблонный движок - Mako_, есть нюансы, но в общем - хорошо;
 - обработка форм - валидаторы FormEncode_, были нюансы - решил своей надстройкой;

JavaScript фреймворк - JQuery_ . Очень доволен возможностями, получаемым кодом и плагинами:
 - `JQuery Cycle Plugin`_ - легкий слйадшоу плагин;
 - `JQuery Form Plugin`_ - плагин упрощающий AJAX-овое обновление форм;
 - ColorBox_ -  легкий, настраиваемый лайтбокс плагин;

.. _Pylons: http://pylonshq.com
.. _ORM: http://ru.wikipedia.org/wiki/ORM
.. _SQLAlchemy: http://www.sqlalchemy.org/
.. _Elixir: http://elixir.ematia.de/trac/wiki
.. _Routes: http://routes.groovie.org/
.. _Mako: http://www.makotemplates.org/
.. _JQuery: http://jquery.com/
.. _FormEncode: http://formencode.org/
.. _`JQuery Cycle Plugin`: http://malsup.com/jquery/cycle/
.. _`jQuery Form Plugin`: http://malsup.com/jquery/form/
.. _ColorBox: http://colorpowered.com/colorbox/','2009-11-23 16:51:17.243792','2009-11-23 16:30:54.329461','2010-09-05 19:22:57.510679');
INSERT INTO "article" VALUES(11,'reStructuredText','reStructuredText',NULL,' **reStructuredText (rst, reST)** - `WYSIWYG <http://ru.wikipedia.org/wiki/WYSIWYG>`_ текстовый язык разметки, который доступен для чтения, и несмотря на простоту достаточно мощный для нетривиального использования. |rst| можно преобразовать в HTML, для отображения в браузере.

.. |rst| replace:: **reStructuredText**

Ниже приведен краткий обзор синтаксиса |rst|, достаточный для форматирования отчетов, на примерах.

Заголовки
---------
Для создания заголовка используется подчеркивание знаками "-" и "=". 
При этом заголовок должен отделяться от текста пустой строкой сверху, снизу не обязательно.

*Например, нужно получить:*

Заголовок первого уровня
------------------------

Заголовок второго уровня
========================


*Для этого в reStructuredText пишем:*

.. code-block:: rst

 Заголовок первого уровня
 ------------------------

 Заголовок второго уровня
 ========================

-------------------

Абзацы
------
Для разбивки текста на абзацы или блоки используется пустая строка. 
Если же два предложения написаны друг под другом (начинаются с первого символа строки, 
то есть без отступов), то они будут преобразованы в сплошной текст.

Без надобности не ставьте пробелов в начале строки. В противном случае получим  
